        opacity: .95;
    }

    & > * {
        z-index: 30;
    }
}

.rfl-title {
    position: absolute;
    width: @400px + @60px;
    left: @120px;
    top: @120px;
    z-index: 10;
    color: #fff;
}

.flat-steps-wrapper {
    width: @590px;
    position: absolute;
    top: 0px;
    right: @200px;
    height: 100vh;
    overflow: auto;


    &::-webkit-scrollbar {
        width: 0px !important;
    }

    &::-webkit-scrollbar-track {
        background: transparent;
        -webkit-border-radius: @10px;
        border-radius: @10px;
    }

    &::-webkit-scrollbar-thumb {
        -webkit-border-radius: @10px;
        border-radius: @10px;
        background: rgba(255, 255, 255, 0.2) !important;
    }

    &::-webkit-scrollbar-thumb:window-inactive {
        background: rgba(255, 255, 255, 0.2) !important;
    }

}

.flat-steps-wrapper {
    padding: @120px @40px @80px;

    & > div {
        display: flex;
        align-items: center;
        color: #fff;
        margin-bottom: @32px;
        .anim;

        .rfl-step-levels {
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            margin-left: @32px;

            i {
                width: @12px;
                height: @12px;
                border-radius: 50%;
                background: rgba(255, 255, 255, 0.2);
                display: inline-block;
                min-width: @12px;
                min-height: @12px;
                margin: @4px 0;
                .anim;

                &.active {
                    background: #4EFFEA;
                }
            }
        }

        & > p {
            .anim;
        }

        &.active {
            transform-origin: left center;

            &:hover {
                cursor: pointer;
                transform: rotate(2deg);

                & > p {
                    text-shadow: 0 0 @30px white;
                }

                .rfl-step-image {
                    background: rgba(20, 27, 31, 0.9);
                }
            }
        }

        &.completed {
            .rfl-step-image {
                border: @2px solid #4EFFEA;
                box-shadow: 0px 0px @40px rgba(78, 255, 234, 0.2);
            }

            color: #4EFFEA;
        }

        &.lock {
            .rfl-step-image {
                background: rgba(20, 27, 31, 0.3);

                & > p,
                & > img {
                    opacity: .2;
                }

                &:after {
                    content: '';
                    width: @24px;
                    height: @24px;
                    position: absolute;
                    left: 50%;
                    top: 50%;
                    transform: translate(-50%, -50%);
                    display: block;
                    background: url('./svg/lock-white.svg') no-repeat;
                    background-size: 100%;

                }
            }
        }

        p {
            &:last-child {
                width: @200px;
            }

            &.rfl-count {
                width: @40px;
            }
        }
    }

    .rfl-step-image {
        width: @160px;
        position: relative;
        height: @160px;
        background: rgba(20, 27, 31, 0.7);
        border-radius: @6px;
        display: flex;
        align-items: center;
        justify-content: center;
        flex-direction: column;
        .anim;

        p {
            margin-bottom: @10px;
            text-align: center;
            width: 80%;
        }

